description:
Superstar genetic engineers Clive and Elsa specialize in splicing DNA from different animals to create incredible new hybrids.

Now they want to use human DNA in a hybrid that could revolutionize science and medicine. But when the pharmaceutical company that funds their research forbids it, they secretly take their experiment underground, risking their careers to push the boundaries of science and serve their own curiosity and ambition. The result is Dren, an amazing, strangely beautiful creature of uncommon intelligence and unexpected physical developments.

At first, Dren exceeds their wildest dreams. But as she grows and learns at an accelerated rate, her existence threatens to become their worst nightmare...

